import logo from './logo.svg';
import './App.css';
const axios = require('axios');

function App() {

  useEffect(() => {
    axios.get('http://localhost:8080/place_order')
      .then(function (response) {
        // handle success
        console.log(response);
      })
      .catch(function (error) {
        // handle error
        console.log(error);
      })
      .then(function () {
        // always executed
      });
  }, [])

  return (
    <div className="App">
   <div>
      <h2>House Blend, $1.49</h2>
      <p> A smooth, mild blend of coffee</p>
   </div>
   <div>
      <h2>Mocha Caffe Latte, $2.35</h2>
      <p>Espresso, steamed with milk and chocolate syrup</p>
   </div>
   <div>
      <h2>Cappucino, $1.89</h2>
      <p>A mixture of espresso, steamed milk, and milk foam</p>
   </div>
   <div>
      <h2>Chai Tea, $1.85</h2>
      <p>A drink made with black tea, milk, and honey</p>
   </div>

   <form action="/" method="post">
    <label htmlFor="card_number">Card #</label>
    <input type="text" name="card_number" id="card_number"/>
    <input type="submit" value="Place Order"/>
   </form>
    </div>
  );
}

export default App;
